import logo from "./logo.svg";
import "./App.css";
import LoginComponent from "./Components/LoginComponent";
import { BrowserRouter as Router, Route, Switch } from "react-router-dom";

function App() {
  return (
    <div>
      <Router>
        <div className="App">
          <Switch>
            <Route path="/login" exact component={LoginComponent} />
          </Switch>
        </div>
      </Router>
    </div>
  );
}

export default App;
